import React, { Component } from "react";
import { useHistory } from "react-router-dom";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
} from "react-router-dom";

export const FeaturesFind = (props) => {
  let history = useHistory();

  function handleClick() {
    history.push("/stages-demandes");
  }
  return (
    <div id="features" className="text-center">
      <div className="container">
        <div className="col-12 section-title">
          <h2>Votre futur stagiaire se trouve ici.</h2>
        </div>
        <div className="row">
          {props.data
            ? props.data.map((d, i) => (
                <div key={`${d.title}-${i}`} className="col-xs-6 col-md-3 mb-5">
                  {" "}
                  <h3>{d.title}</h3>
                  <p>{d.text}</p>
                </div>
              ))
            : "Loading..."}
        </div>
        <div className="list-buttom" style={{ marginBottom: "70px" }}>
          {/* <a
            className="btn btn-custom btn-lg page-scroll"
            onClick={handleClick}
          > */}
          <Link
            to={`../views/stages-demandes`}
            activeClassName="current"
            className="btn btn-custom btn-lg page-scroll"
          >
            Voir tous les candidats
          </Link>
          {/* <a
            className="btn btn-custom btn-lg page-scroll"
            as={Link}
            to={"../views/stages-demandes"}
          >
            Voir tous les candidats
          </a>{" "} */}
        </div>
      </div>
    </div>
  );
};
